  Raijele b. at Suva, Fiji.
  04> WARREN, Thomas Nation m on 27.11.1991 to HEERDEGEN, Joanne Lee
  b 27.04.1961
  b 05.12.1960
  Joanne, d/o Barry Heerdegen and Judith Ann Carde. Address: 405 Taupaki Road, RD 2, Taupaki,
  Auckland.
  Tom was educated at Hereworth School, Wanganui Collegiate School, Central Hawkes Bay College and
  Lincoln University. He managed a family farm in Taumarunui, became a boat builder, and then became
  involved in professional yachting. He was a full-time crew member on Il Moro De Venezia, which won
  the 1988 Maxi World Championship for Italy. Tom then joined Fisher and Paykel New Zealand and
  sailed the Whitbread Round the World race in which the yacht was placed second overall. He
  subsequently crewed on Rothmans, which came third in the Maxi offshore racing competition, (winning
  the Sydney-Hobart race, only to be disqualified, then reinstated to third position). Tom managed
  Orams Marine Boat Yard at Westhaven, Auckland. He then became General Manager of Refit NZ Ltd in
  Tauranga, and is now self-employed as a marine consultant.
  Jo was educated at Selwyn College and Rangitoto College and works in the travel industry. She was
  Marketing Manager for Flexiplan Holidays in Auckland and is now employed as New Zealand manager for
  Tourism New South Wales.
  Both are keen sportspeople, especially in yachting, fishing, diving, tennis and swimming.
  05> WARREN, Rachel Dinah m on 03.12.1983 to (1) STEEL, Christopher
  b 25.09.1963
  Rachel b. at Hastings. Divorced.
  * ** ****
  05> WARREN, Rachel Dinah and (2)ARCHAMBAULT, Marc
  b 25.09.1963
  b 10.11.1966
  Marc, slo Gilles Archambault and Lise Gendron, b. at Quebec, Canada. Address: 99 Sukhumvit SO1 24,
  39c Oak Tower, Bangkok 10110, Thailand.
  Rachel was educated at Woodford House, Taupo-Nui-a-Tia College and Massey University. During her
  marriage she was sharemilking at Kaitoke before moving to Wellington alone. She later lived at
  Taupo working as a dental hygienist. Gaining English language teaching qualifications, she moved
  to Singapore where she taught English at a language school for seven years whilst at the same time
  building her own portfolio of private students.
  Rachel and Marc now live in Thailand where Rachel has set up and is the manager of the English
  Language Department for a Thai-Japanese venture.
  Marc was educated at Le Seminaire de St Hyacinthe and graduated from Laval University, Quebec City,
  in 1990. He is an actuary by training, working in the re-insurance field, and started his career
  in Paris working for Scor. After his posting to Singapore, overseeing the Asian Region for the
  company, he was transferred to Thailand to start a joint venture between a local company and Scor.
  Both are keen and very active sportspeople and avid travellers.
  02> WARREN, Roger Greville m on 03.05.1958 to TURNER, Jenifer Jane Mandeville
  b 24.07.1928
  b 04.09.1936
